/**
* GeoChart 
* @constructor.
*/
function GeoChart(container_id) {

    /**
    * Defaults chat options.
    */
    var DEFAULT_OPTIONS = {
        viewOptions: { coordinates: [37.8, -96], size: 3.7 }
    };

    /**
    * Initializa chart
    * @param {Object} config. Chart configuration.
    */
    this.initChart = function (config) {

        config_ = config;
        if (!container_id) return false;

        map = L.map(container_id).setView(DEFAULT_OPTIONS["viewOptions"]["coordinates"], DEFAULT_OPTIONS["viewOptions"]["size"]);

        //       L.tileLayer('http://{s}.tile.cloudmade.com/{key}/{styleId}/256/{z}/{x}/{y}.png', {
        //     key: 'BC9A493B41014CAABB98F0471D759707',
        //            styleId: 22677
        //}).addTo(map);

        map._layersMaxZoom = 10;
        map._layersMinZoom = 2;
        initInfo();
        initLegend();
    };

    /**
    * Initialization of informational tooltip.
    * @private
    */
    var initInfo = function () {
        if (!config_["info"]) return;
        info = L.control();

        info.onAdd = function () {
            this._div = L.DomUtil.create('div', 'info');
            this.update();
            return this._div;
        };

        info.update = function (props) {
            if (props) {
                this._div.innerHTML = ((props.density != -1) ?
                    '<b>' + props.name + '</b><br />' + props.density.toFixed(2).toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",").replace(".00", "") + '</sup>'
                    : '<b>' + props.name + '</b>');
            } else {
                this._div.innerHTML = 'Hover over a state';
            }

        };

        info.addTo(map);
    }

    // get color depending on population value
    function getColor(d) {

        return d == -1 || d == 0 ? 'white' :
            d > 175 ? '#99FF99' :
                d > 120 && d <= 175 ? '#59D6FF' :
                    80 <= d && d <= 120 ? '	#FFFFA3' :
                        d < 80 ? '#FF8566' : '#FF8566';
    }

    function style(feature) {

        return {
            weight: 2,
            opacity: 1,
            color: 'white',
            dashArray: '3',
            fillOpacity: 0.7,
            fillColor: getColor(feature.properties.density)

        };
    }

    function customStyle(feature) {
        return {
            weight: 2,
            opacity: 1,
            color: 'white',
            dashArray: '3',
            fillOpacity: 0.7,
            fillColor: getColor(feature.properties.density)
        };
    }


    // Highlight region
    function highlightFeature(e) {
        var layer = e.target;

        layer.setStyle({
            weight: 3,
            color: 'white',
            dashArray: ''
            //  fillOpacity: 0.7
        });

        if (!L.Browser.ie && !L.Browser.opera) {
            layer.bringToFront();
        }
        info.update(layer.feature.properties);

    }

    function resetHighlight(e) {
        geojson.resetStyle(e.target);
        info.update();
    }

    // zoom region
    function zoomToFeature(e) {

        var dmaMap = getDMAByStateName(e.target.feature.properties.name);
        L.geoJson(dmaMap["data"], {
            style: dmaMap["style"],
            onEachFeature: onEachFeature
        }).addTo(map);
        map.fitBounds(e.target.getBounds());
    }


    function onEachFeature(feature, layer) {
        layer.on({
            mouseover: highlightFeature,
            mouseout: resetHighlight
            // click: zoomToFeature
        });
    }

    /**
    * Draws the geochart component.
    * @this {GeoChart}
    */
    this.draw = function () {
        for (var index = 0; index < maps_.length; index++) {
            geojson = L.geoJson(maps_[index]["data"], {
                style: customStyle, // maps_[index]["style"],
                onEachFeature: onEachFeature
            }).addTo(map);
        }
    }

    /**
    * Sets data for geochart
    * @param {object} data.
    */
    this.setMaps = function (maps) {
        maps_ = maps;
    }

    //TODO create method wich returns dma regions by state name
    var getDMAByStateName = function (name) {
        var customRegion = counties;
        log(customRegion);
        //        { "type": "FeatureCollection", "features": [
        //        { "type": "Feature", "id": "502", "properties": { "name": "DMA-1", "value": 100 },
        //            "geometry": { "type": "Polygon", "coordinates": [[[-81, 45], [-82, 43], [-96, 43], [-95, 45]]] }
        //        },
        //        { "type": "Feature", "id": "501", "properties": { "name": "DMA-2", "value": 150 },
        //            "geometry": { "type": "Polygon", "coordinates": [[[-85, 35], [-85, 33], [-96, 33], [-95, 35]]] }
        //        },
        //        { "type": "Feature", "id": "501", "properties": { "name": "DMA-3", "value": 50 },
        //            "geometry": { "type": "Polygon", "coordinates": [[[-88, 40], [-88, 38], [-86, 38], [-86, 40]]] }
        //        }]
        //        };
        //        
        var customRegionStyle = {
            "color": "#1f2345",
            "weight": 2,
            "opacity": 0.8
        };

        return { data: customRegion, style: style };

    }

    /* contains array of data for creating maps
    * @type {Array}
    * @private
    */
    var maps_ = [];

    //TODO modify method for using custom legend
    var initLegend = function () {
        if (!config_["legend"]) return;
        legend = L.control({ position: 'bottomright' });
        legend.onAdd = function () {

            var div = L.DomUtil.create('div', 'info legend'),
                grades = [0, 80, 120, 175],
                labels = [],
                from, to;

            for (var i = 0; i < grades.length; i++) {
                from = grades[i];
                to = grades[i + 1];

                labels.push(
                    '<i style="background:' + getColor(from + 1) + '"></i> ' +
                        from + (to ? '&ndash;' + to : '+'));
            }

            div.innerHTML = labels.join('<br>');
            return div;
        };

        legend.addTo(map);
    }

    this.setGeoData = function (geoData) {
        counties = geoData;
    };

    var config_ = null;
    var datageo = null;
    var map = null;
    var info = null;
    var geojson = null;
    var legend = null;
    var self_ = this;
    var counties = null;
}

window["GeoChart"] = GeoChart;